import React from 'react';
import SharedContext from './SharedContext';
import {AppBar, Toolbar, IconButton, Box, TextField} from '@mui/material';
import ArrowBackIosNewIcon from '@mui/icons-material/ArrowBack';
import ArrowForwardIcon from '@mui/icons-material/ArrowForward';

/**
 * @return {object} JSX
 */
function Composing() {
  const {mailid, setMailid, setComp} = React.useContext(SharedContext);
  const mid = mailid;
  setMailid('');
  console.log(mid);
  const goBack = () => {
    setComp(false);
    setMailid(mid);
  };

  return (
    <Box>
      <AppBar position='fixed'>
        <Toolbar sx={{justifyContent: 'space-between'}}>
        <IconButton
          onClick={() => goBack()}
            role='button'
            aria-label='go back'>
            <ArrowBackIosNewIcon />
          </IconButton>
          <div>
            <IconButton
              role='button'
              aria-label='sent'>
              <ArrowForwardIcon />
            </IconButton>
          </div>
        </Toolbar>
        </AppBar>
        <Toolbar />
        <TextField
                margin="normal"
                id="to"
                name="to"
                size='small'
                fullWidth
                sx={{background: 'white'}}
              />
        <TextField
                margin="normal"
                id="subject"
                name="subject"
                size='small'
                fullWidth
                sx={{background: 'white'}}
              />
        <TextField
                margin="normal"
                id="content"
                name="content"
                fullWidth
                multiline
                sx={{background: 'white'}}
              />
    </Box>
  );
}

export default Composing;
